import React, { Component } from 'react';

class BookList extends Component {
    render() {
        return (
            <div className='book-list'>
                <ul>
                    <li>Inferno</li>
                    <li>Pendekar Binal</li>
                    <li>Lost Symbol</li>
                </ul>
            </div>
        );
    }
}

export default BookList;
